import { observable, action } from "mobx";
import axios from "axios";

export class admin {
  @observable dbName = "";

  @action
  createTableInfo(dbname) {
    console.log(dbname);
    return axios
      .get("https://hanstream.gabia.io/adminCreateFile", {
        params: {
          dbName: dbname,
        },
      })
      .then((response) => {
        console.log(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }
  @action
  async createTable(dbname) {
    await this.createTableInfo(dbname);
  }
}
